import { useSelector, useDispatch } from 'react-redux';
import links, {addLink, deleteLink, linkSlice, updateVotes, sortLinks } from './features/links';
import { useEffect, useReducer, useState } from 'react';
import { useNavigate } from "react-router-dom";
import { Link } from 'react-router-dom';

const Postlink = () => {
    
    return(
        <div>
        <Link to="/">Return to list</Link>
        <div className='postLinkContent'>
            <h2>Add new link</h2>
            <label>Link Name</label>
            <input type={'text'} placeholder="e.g. Alphabet"></input>
            <label>Link Name</label>
            <input type={'url'} placeholder="e.g. http://abc.xyz"></input>
        </div>
        </div>
    )
    
}

export default Postlink;
